webpackJsonp([0xf25cb2e0f8f3],{6153:function(e,t){e.exports={data:{post:{html:"<p>As part of the celebrations of <a href=\"http://www.papascott.de/2003/06/11/2338.php\">Voldemort's birthday</a>, today we are holding the semi-formal garden party for the relatives <em>(mit Erbtante)</em>. Reception with glass of Frexinet at 3pm, coffee and cake at 4pm, light snack at 5:30pm, and hopefully by 6:30pm they get the idea it's time to leave. Tip for hosting such an event: open the first bottle of Frexinet at noon. The perspective is then much brighter.</p>",fields:{title:"Garden Party",date:"15 Jun 2003",url:"https://papascott.de/2003-06-15-garden-party/"}}},pathContext:{slug:"/2003-06-15-garden-party/",prev:{fields:{title:"San Francisco Treat",date:"14 Jun 2003",slug:"/2003-06-14-san-francisco-treat/"}},next:{fields:{title:"Garton Ash on Europe and America",date:"16 Jun 2003",slug:"/2003-06-16-garton-ash-on-europe-and-america/"}}}}}});
